    it: '\nQuesto studio necessita di una finestra in incognito/privata, e questa finestra non lo è. Puoi risolvere questo problema. Utilizzando un qualsiasi browser diverso da Safari, apri una finestra in incognito e avvia il link dello studio in quella finestra.\n\nSPIEGAZIONE: Tutti i principali browser permettono di aprire una finestra in modalità incognito, anche se il nome può variare, ad esempio "Incognito", "InPrivate", "Navigazione Privata" o "Finestra Privata". Tutti i browser tranne Safari indicano se la pagina web è in modalità incognito. Safari dice sempre di no. La modalità incognito è tipicamente utilizzata per la privacy. EasyEyes la utilizza per facilitare l\'accesso alla libreria Firebase di EasyEyes, necessaria per la calibrazione del suono.',
    ja: 'Loading...',
    kn: 'Loading...',
    ko: 'Loading...',
    lt: '"Šiam tyrimui reikalingas inkognito / privatus langas, o šis langas toks nėra. Galite tai pataisyti. Naudodami bet kurį naršyklės, išskyrus Safari, atidarykite inkognito langą ir paleiskite tyrimo nuorodą tame lange.\n\nPAAIŠKINIMAS: Visos pagrindinės naršyklės leidžia atidaryti langą inkognito režimu, nors pavadinimas gali skirtis, pvz., "Incognito", "InPrivate", "Private Browsing" arba "Private Window". Visos naršyklės, išskyrus Safari, praneša, ar tinklalapis yra inkognito režime. Safari visada sako ne. Inkognito režimas paprastai naudojamas privatumui. EasyEyes jį naudoja, kad būtų lengviau pasiekti EasyEyes Firebase biblioteką, kuri reikalinga garsų kalibravimui."',
    ms: 'Loading...',
    ml: 'Loading...',
    no: '"Dette studiet trenger et inkognitovindu, og dette vinduet er det ikke. Du kan fikse dette. Bruk en hvilken som helst nettleser annet enn Safari, åpne et inkognitovindu og kjør studielinken i det vinduet.\n\nFORKLARING: Alle større nettlesere lar deg åpne et vindu i inkognitomodus, selv om navnet varierer, f.eks. "Inkognito", "InPrivate", "Privat nettlesing" eller "Privat vindu". Alle nettlesere bortsett fra Safari rapporterer om nettsiden er i inkognitomodus. Safari sier alltid nei. Inkognitomodus brukes vanligvis for personvern. EasyEyes bruker det for å lette tilgangen til EasyEyes Firebase-biblioteket, som er nødvendig for lydkalibrering."',
