    'en-US':
      'As stated in its description, this study needs an incognito/private window, and this window isn’t. You can fix this. Using any browser other than Safari, open an incognito window, and run the study link in that window. \n \nEXPLANATION: All major browsers allow you to open a window in incognito mode, though the name varies, e.g. “Incognito”, “InPrivate”, “Private Browsing”, or “Private Window”. All browsers except Safari report whether the web page is in incognito mode. Safari always says no. Incognito mode is typically used for privacy. EasyEyes uses it to ease access to the EasyEyes Firebase library, which is needed for sound calibration.',
    ar: 'كما هو مذكور في وصفه، هذه الدراسة تحتاج إلى نافذة متخفية/خاصة، وهذه النافذة ليست كذلك. يمكنك إصلاح ذلك. باستخدام أي متصفح غير Safari، افتح نافذة متخفية، وشغّل رابط الدراسة في تلك النافذة.\n\nالشرح: جميع المتصفحات الرئيسية تسمح لك بفتح نافذة في وضع المتخفي، على الرغم من أن الاسم يختلف، مثل "متخفي"، "خاص"، "تصفح خاص"، أو "نافذة خاصة". جميع المتصفحات باستثناء Safari تبلغ عما إذا كانت صفحة الويب في وضع المتخفي. Safari دائمًا يقول لا. يُستخدم وضع المتخفي عادةً للخصوصية. EasyEyes يستخدمه لتسهيل الوصول إلى مكتبة Firebase الخاصة بـ EasyEyes، والتي تُستخدم لمعايرة الصوت.',
