    el: 'Όπως αναφέρεται στην περιγραφή του, αυτή η μελέτη χρειάζεται ένα παράθυρο ανώνυμης/ιδιωτικής περιήγησης, και αυτό το παράθυρο δεν είναι. Μπορείτε να το διορθώσετε. Χρησιμοποιώντας οποιονδήποτε περιηγητή εκτός από το Safari, ανοίξτε ένα παράθυρο ανώνυμης περιήγησης και εκτελέστε τον σύνδεσμο της μελέτης σε αυτό το παράθυρο. \n\nΕΞΗΓΗΣΗ: Όλοι οι μεγάλοι περηγητές σάς επιτρέπουν να ανοίξετε ένα παράθυρο σε λειτουργία ανώνυμης περιήγησης, αν και η ονομασία διαφέρει, π.χ. "Ανώνυμη", "Ιδιωτική", "Ιδιωτική περιήγηση" ή "Ιδιωτικό παράθυρο". Όλοι οι περηγητές εκτός από το Safari αναφέρουν εάν η ιστοσελίδα βρίσκεται σε λειτουργία ανώνυμης περιήγησης. Το Safari λέει πάντα όχι. Η λειτουργία ανώνυμης περιήγησης χρησιμοποιείται τυπικά για την ιδιωτικότητα. Το EasyEyes τη χρησιμοποιεί για να διευκολύνει την πρόσβαση στη βιβλιοθήκη Firebase του EasyEyes, η οποία χρειάζεται για τη βαθμονόμηση του ήχου.',
