    is: 'Rannsakandinn biður þig um að gefa upp EasyEyes ID frá fyrri skipti, vinsamlegast skrifaðu það hérna eða hlaða upp skránni sem var niðurhöfð í lok síðasta skiptis.',
    id: 'Peneliti meminta Anda memberikan ID EasyEyes Anda dari sesi sebelumnya, silakan ketik di sini, atau unggah file yang diunduh saat sesi terakhir berakhir.',
    it: "Il ricercatore richiede che tu fornisca il tuo ID EasyEyes dalla sessione precedente, per favore digitalo qui, oppure carica il file scaricato al termine dell'ultima sessione.",
    ja: '研究者は、前のセッションの EasyEyes ID を提供するよう要求します。ここに入力するか、最後のセッションの終了時にダウンロードしたファイルをアップロードしてください。',
    kn: 'ಹಿಂದಿನ ಸೆಶನ್‌ನಿಂದ ನಿಮ್ಮ EasyEyes ID ಅನ್ನು ನೀವು ಒದಗಿಸುವಂತೆ ಸಂಶೋಧಕರು ವಿನಂತಿಸುತ್ತಾರೆ, ದಯವಿಟ್ಟು ಅದನ್ನು ಇಲ್ಲಿ ಟೈಪ್ ಮಾಡಿ ಅಥವಾ ಕೊನೆಯ ಸೆಷನ್‌ ಮುಗಿದಾಗ ಡೌನ್‌ಲೋಡ್ ಮಾಡಿದ ಫೈಲ್ ಅನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಿ.',
    ko: '연구원은 이전 세션에서 EasyEyes ID를 제공하도록 요청합니다. 여기에 입력하거나 마지막 세션이 끝나면 다운로드한 파일을 업로드하십시오.',
    lt: 'Mokslininkas prašo, kad pateiktumėte savo EasyEyes ID iš ankstesnės sesijos, prašome įvesti jį čia arba įkelti failą, atsisiųstą baigus paskutinę sesiją.',
    ms: 'Penyelidik meminta anda memberikan ID EasyEyes anda dari sesi sebelumnya, sila taipkannya di sini atau muat naik fail yang dimuat turun apabila sesi terakhir tamat.',
    ml: 'മുമ്പത്തെ സെഷനിൽ നിന്ന് നിങ്ങളുടെ EasyEyes ഐഡി നൽകണമെന്ന് ഗവേഷകൻ അഭ്യർത്ഥിക്കുന്നു, ദയവായി അത് ഇവിടെ ടൈപ്പ് ചെയ്യുക അല്ലെങ്കിൽ അവസാന സെഷൻ അവസാനിക്കുമ്പോൾ ഡൗൺലോഡ് ചെയ്ത ഫയൽ അപ്‌ലോഡ് ചെയ്യുക.',
    no: 'Forskeren ber om at du oppgir din EasyEyes-ID fra forrige økt, vennligst skriv den inn her eller last opp filen som ble lastet ned da forrige økt avsluttet.',
    fa: 'محقق درخواست می‌کند که شناسه EasyEyes خود را از جلسه قبلی ارائه دهید، لطفاً آن را در اینجا تایپ کنید یا فایلی که در پایان جلسه گذشته دانلود شده است، آپلود کنید.',
    pl: 'Badacz prosi o podanie identyfikatora EasyEyes z poprzedniej sesji. Wpisz go tutaj lub prześlij plik pobrany po zakończeniu ostatniej sesji.',
    pt: 'O pesquisador solicita que você forneça seu ID EasyEyes da sessão anterior, por favor digite-o aqui ou faça o upload do arquivo baixado quando a última sessão terminar.',
    ro: 'Cercetatorul vă solicită să furnizați ID-ul EasyEyes din sesiunea anterioară, vă rugăm să-l introduceți aici sau să încărcați fișierul descărcat când se termină ultima sesiune.',
    ru: 'Исследователь просит вас предоставить свой идентификатор EasyEyes из предыдущего сеанса. Введите его здесь или загрузите файл, загруженный после завершения последнего сеанса.',
    sr: 'Истраживач захтева да доставите свој ЕасиЕиес ИД из претходне сесије, унесите га овде или отпремите преузету датотеку када се последња сесија заврши.',
    es: 'El investigador solicita que proporciones tu ID de EasyEyes de la sesión anterior, por favor ingrésalo aquí o sube el archivo descargado al finalizar la última sesión.',
    su: 'Panaliti nyuhunkeun anjeun nyayogikeun ID EasyEyes anjeun ti sési saméméhna, punten ketik di dieu, atanapi unggah file anu diunduh nalika sési terakhir réngsé.',
    sw: 'Mtafiti anaomba utoe kitambulisho chako cha EasyEyes kutoka kwa kipindi kilichopita, tafadhali kichape hapa, au pakia faili iliyopakuliwa kipindi cha mwisho kinapoisha.',
    sv: 'Forskaren ber dig att ange ditt EasyEyes ID från föregående session, vänligen skriv det här eller ladda upp filen som laddades ner när den förra sessionen avslutades.',
    tl: 'Hiniling ng mananaliksik na ibigay mo ang iyong EasyEyes ID mula sa nakaraang sesyon, mangyaring itype ito dito, o i-upload ang file na na-download kapag natapos ang huling sesyon.',
    tr: "Araştırmacı sizden bir önceki oturuma ait EasyEyes ID'nizi vermenizi talep etmektedir, lütfen buraya yazınız veya son oturum bittiğinde indirdiğiniz dosyayı yükleyiniz.",
    ur: 'محقق درخواست کرتا ہے کہ آپ پچھلے سیشن سے اپنی EasyEyes ID فراہم کریں، براہ کرم اسے یہاں ٹائپ کریں، یا آخری سیشن ختم ہونے پر ڈاؤن لوڈ کی گئی فائل اپ لوڈ کریں۔',
