    it: 'È necessario un ID unico per collegare i dati tra le sessioni. Questo computer ha precedentemente partecipato a una sessione il **ddd** con l\'ID EasyEyes “**sss**”. Premi OK se sei tu. Altrimenti, se hai un file ID EasyEyes, premi il pulsante di selezione del file qui sotto per aprirlo. (Il nome del file inizia con "EasyEyes", termina con ".txt" ed è tipicamente nella tua cartella Download.) Se non hai un file, ma conosci il tuo ID EasyEyes, allora digitalo. Altrimenti, inventa un tuo ID, che può essere una stringa alfanumerica di almeno 5 caratteri. Può essere il tuo nome, se preferisci. Lo ricorderemo per te su questo computer, ma se vai su un altro computer, per favore porta con te il tuo file ID EasyEyes (il file più recente nella tua cartella Download), o almeno annota il tuo ID EasyEyes. Usalo ogni volta per collegare i tuoi dati da sessione a sessione.',
