      "❓The typed answer doesn't match anything in our limited database. If you're sure it's right, ignore this warning, and finish typing it.",
    ar: '❓الإجابة المكتوبة لا تتطابق مع أي شيء في قاعدة بياناتنا المحدودة. إذا كنت متأكدًا من صحتها، تجاهل هذا التحذير وأكمل كتابتها.',
    hy: '❓Մուտքագրված պատասխանը չի համընկնում մեր սահմանափակ տվյալների բազայում: Եթե ​​վստահ եք, որ դա ճիշտ է, անտեսեք այս նախազգուշացումը և ավարտեք այն մուտքագրելը:',
    bg: '❓Въведеният отговор не отговаря на нищо в нашата ограничена база данни. Ако сте сигурни, че е правилно, игнорирайте това предупреждение и довършете въвеждането му.',
    'zh-CN':
      '❓输入的答案与我们有限的数据库中的任何内容都不匹配。如果您确定它是正确的，请忽略此警告并完成输入。',
    'zh-HK':
      '❓輸入的答案與我們有限的資料庫中的任何內容都不符。如果您確定它是正確的，請忽略此警告並完成輸入。',
    hr: '❓Upisani odgovor ne odgovara ničemu u našoj ograničenoj bazi podataka. Ako ste sigurni da je ispravno, zanemarite ovo upozorenje i dovršite ga s upisivanjem.',
    cs: '❓Zadaná odpověď neodpovídá ničemu v naší omezené databázi. Pokud jste si jisti, že je to správné, ignorujte toto varování a dokončete jeho psaní.',
    da: '❓Det indtastede svar matcher ikke noget i vores begrænsede database. Hvis du er sikker på, at det er rigtigt, skal du ignorere denne advarsel og afslutte med at skrive den.',
