    'en-UK':
      "❓The typed answer doesn't match anything in our limited database. If you're sure it's right, ignore this warning, and finish typing it.",
    fi: '❓Kirjoitettu vastaus ei vastaa mitään rajoitetusta tietokannastamme. Jos olet varma, että se on oikein, jätä tämä varoitus huomioimatta ja kirjoita se loppuun.',
    fr: "La réponse tapée ne correspond à rien dans notre base de données limitée. Si vous êtes sûr qu'elle est correcte, ignorez cet avertissement et terminez de la taper.",
    de: '❓Die eingegebene Antwort stimmt mit nichts in unserer begrenzten Datenbank überein. Wenn Sie sicher sind, dass es richtig ist, ignorieren Sie diese Warnung und geben Sie die Eingabe zu Ende.',
    el: '❓Η πληκτρολογημένη απάντηση δεν αντιστοιχεί σε κάτι στην περιορισμένη μας βάση δεδομένων. Εάν είστε σίγουροι ότι είναι σωστή, αγνοήστε αυτήν την προειδοποίηση και συνεχίστε να την πληκτρολογείτε.',
    he: '❓התשובה שהוקלדה אינה תואמת לשום דבר במסד הנתונים המצומצם שלנו. אם אתה בטוח שזה נכון, התעלם מהאזהרה הזו וסיים להקליד אותה.',
    hi: '❓टाइप किया गया उत्तर हमारे सीमित डेटाबेस में किसी भी चीज़ से मेल नहीं खाता है। यदि आप आश्वस्त हैं कि यह सही है, तो इस चेतावनी पर ध्यान न दें और इसे टाइप करना समाप्त करें।',
    hu: '❓A beírt válasz nem egyezik semmivel a korlátozott adatbázisunkban. Ha biztos benne, hogy helyes, hagyja figyelmen kívül ezt a figyelmeztetést, és fejezze be a beírását.',
    is: '❓Værða svarið passar ekki við neitt í okkar takmarkaða gagnagrunni. Ef þú ert viss um að það sé rétt skaltu hunsa þessa viðvörun og klára að slá hana inn.',
    id: '❓Jawaban yang diketik tidak sesuai dengan database kami yang terbatas. Jika Anda yakin itu benar, abaikan peringatan ini, dan selesaikan mengetiknya.',
    it: '❓La risposta digitata non corrisponde a nulla nel nostro database limitato. Se sei sicuro che sia corretta, ignora questo avviso e completa la digitazione.',
    ja: '❓入力された回答は、限られたデータベース内のどの回答にも一致しません。それが正しいと確信できる場合は、この警告を無視して、入力を完了してください。',
    kn: '❓ಟೈಪ್ ಮಾಡಿದ ಉತ್ತರವು ನಮ್ಮ ಸೀಮಿತ ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿ ಯಾವುದಕ್ಕೂ ಹೊಂದಿಕೆಯಾಗುವುದಿಲ್ಲ. ಇದು ಸರಿ ಎಂದು ನಿಮಗೆ ಖಚಿತವಾಗಿದ್ದರೆ, ಈ ಎಚ್ಚರಿಕೆಯನ್ನು ನಿರ್ಲಕ್ಷಿಸಿ ಮತ್ತು ಟೈಪ್ ಮಾಡುವುದನ್ನು ಮುಗಿಸಿ.',
    ko: '❓입력한 답변이 제한된 데이터베이스의 어떤 항목과도 ​​일치하지 않습니다. 그것이 맞다고 확신한다면 이 경고를 무시하고 입력을 마치십시오.',
    lt: '❓Įvestas atsakymas nieko neatitinka mūsų ribotoje duomenų bazėje. Jei esate tikri, kad tai teisinga, nepaisykite šio įspėjimo ir baikite jį vesti.',
    ms: '❓Jawapan yang ditaip tidak sepadan dengan apa-apa dalam pangkalan data terhad kami. Jika anda pasti ia betul, abaikan amaran ini dan selesaikan menaipnya.',
    ml: '❓ടൈപ്പ് ചെയ്‌ത ഉത്തരം ഞങ്ങളുടെ പരിമിതമായ ഡാറ്റാബേസിലെ ഒന്നിനോടും പൊരുത്തപ്പെടുന്നില്ല. ഇത് ശരിയാണെന്ന് നിങ്ങൾക്ക് ഉറപ്പുണ്ടെങ്കിൽ, ഈ മുന്നറിയിപ്പ് അവഗണിച്ച് ടൈപ്പ് ചെയ്യുന്നത് പൂർത്തിയാക്കുക.',
    no: '❓Svaret du skrev stemmer ikke overens med noe i vår begrensede database. Hvis du er sikker på at det er riktig, kan du ignorere denne advarselen og fortsette å skrive det.',
    fa: '❓پاسخ تایپ شده با هیچ چیز در پایگاه داده محدود ما مطابقت ندارد. اگر مطمئن هستید که درست است، این هشدار را نادیده بگیرید و تایپ آن را تمام کنید.',
    pl: '❓Wpisana odpowiedź nie pasuje do niczego w naszej ograniczonej bazie danych. Jeśli masz pewność, że jest prawidłowy, zignoruj ​​to ostrzeżenie i dokończ wpisywanie.',
    pt: '❓A resposta digitada não corresponde a nada em nosso banco de dados limitado. Se tiver certeza de que está certo, ignore este aviso e termine de digitá-lo.',
    ro: '❓Răspunsul tastat nu se potrivește cu nimic din baza noastră de date limitată. Dacă sunteți sigur că este corect, ignorați această avertizare și continuați să-l tastați.',
    ru: '❓Введенный ответ не соответствует ничему в нашей ограниченной базе данных. Если вы уверены, что он правильный, проигнорируйте это предупреждение и продолжайте его вводить.',
    sr: '❓Укуцани одговор се не подудара ни са чим у нашој ограниченој бази података. Ако сте сигурни да је тачно, занемарите ово упозорење и завршите са куцањем.',
