    ar: '\nهاتفك Firefox. نحتاج تفاصيل تحدد طرازه. اذهب إلى الإعدادات > حول الهاتف (كان يُعرف سابقًا بـ "حول الجهاز"). انسخ اسم الطراز والرقم إلى الحقول المقابلة أدناه.\n',
    hy: 'Ձեր Firefox ՀԵՌԱԽՈՍԸ: Մեզ անհրաժեշտ են մանրամասներ, որոնք նշում են դրա մոդելը: Գնացեք Կարգավորումներ > Հեռախոսի մասին (նախկինում՝ «Սարքի մասին»): Պատճենեք մոդելի անվանումը և համարը ստորև ներկայացված համապատասխան դաշտերում:',
