    cs: 'VÁŠ TELEFON s Firefoxem. Potřebujeme podrobnosti specifikující jeho model. Přejděte do Nastavení > O telefonu (dříve „O zařízení“). Zkopírujte název a číslo modelu do příslušných polí níže.',
