    ar: '\nجهاز الكمبيوتر الخاص بك بنظام ويندوز. نحتاج إلى تفاصيل تحدد العلامة التجارية والموديل. افتح القائمة الرئيسية. ابحث عن معلومات النظام وانقر على النتيجة الأولى لفتح التطبيق.\nانقر على ملخص النظام.\nانظر تحت حقل "موديل النظام".\nانسخ اسم الموديل والرقم إلى الحقول المقابلة أدناه.\n',
