    fr: '\nVOTRE ORDINATEUR Windows. Nous avons besoin de détails spécifiant sa marque et son modèle. Ouvrez le menu Démarrer. Recherchez Informations Système et cliquez sur le premier résultat pour ouvrir l\'application.\nCliquez sur Résumé du Système.\nRegardez sous le champ "Modèle du Système".\nCopiez le Nom et le Numéro du Modèle dans les champs correspondants ci-dessous.',
    de: '"DEIN Windows COMPUTER. Wir benötigen Angaben zum Hersteller und Modell. Öffne Start. Suche nach Systeminformationen und klicke auf das oberste Ergebnis, um die App zu öffnen.\nKlicke auf Systemzusammenfassung.\nSchau unter dem Feld "Systemmodell" nach.\nKopiere den Modellnamen und die Nummer in die entsprechenden Felder unten."',
    el: 'Loading...',
    he: 'המחשב שלך במערכת הפעלה Windows. אנחנו זקוקים לפרטים המפרטים את היצרן והדגם שלו. פתח את תפריט ההתחלה. חפש את מידע המערכת ולחץ על התוצאה העליונה כדי לפתוח את היישום.\nלחץ על סיכום המערכת.\nחפש בשדה "דגם המערכת".\nהעתק את שם הדגם והמספר לשדות המתאימים למטה.',
    hi: 'आपका Windows कंप्यूटर। हमें इसके ब्रांड और मॉडल के बारे में विवरण चाहिए। स्टार्ट खोलें। सिस्टम जानकारी खोजें और ऐप खोलने के लिए शीर्ष परिणाम पर क्लिक करें।\nसिस्टम सारांश पर क्लिक करें।\n"सिस्टम मॉडल" फ़ील्ड के नीचे देखें।\nमॉडल नाम और नंबर को नीचे के संबंधित फ़ील्ड में कॉपी करें।',
    hu: 'Loading...',
    is: 'Loading...',
    id: '"KOMPUTER Windows ANDA. Kami memerlukan rincian yang menyebutkan merek dan modelnya. Buka Start. Cari Informasi Sistem dan klik hasil teratas untuk membuka aplikasinya.\nKlik pada Ringkasan Sistem.\nLihat di bawah kolom "Model Sistem".\nSalin Nama dan Nomor Model ke kolom yang sesuai di bawah ini."',
    it: '\nIL TUO computer Windows. Abbiamo bisogno di dettagli che specificano la marca e il modello. Apri Start. Cerca Informazioni Sistema e clicca sul primo risultato per aprire l\'app.\nClicca su Riepilogo Sistema.\nGuarda sotto il campo "Modello Sistema".\nCopia il Nome e il Numero del Modello nei campi corrispondenti qui sotto.',
