    ms: 'KOMPUTER Windows ANDA. Kami memerlukan butiran yang menentukan jenama dan modelnya. Buka Mula. Cari Maklumat Sistem dan klik hasil teratas untuk membuka aplikasi.\nKlik pada Ringkasan Sistem.\nLihat di bawah bidang "Model Sistem".\nSalin Nama dan Nombor Model ke bidang yang berkaitan di bawah.',
    ml: 'Loading...',
    no: 'Loading...',
    fa: 'Loading...',
    pl: 'Loading...',
    pt: '"SEU COMPUTADOR Windows. Precisamos de detalhes especificando sua marca e modelo. Abra o Iniciar. Pesquise por Informações do Sistema e clique no resultado principal para abrir o aplicativo.\nClique em Resumo do Sistema.\nProcure pelo campo "Modelo do Sistema".\nCopie o Nome e Número do Modelo para os campos correspondentes abaixo."',
