    sv: 'Loading...',
    tl: '"ANG iyong Windows COMPUTER. Kailangan namin ng mga detalye na nagtatakda ng tatak at modelo nito. Buksan ang Start. Maghanap ng Impormasyon sa System at i-click ang nangungunang resulta upang buksan ang app.\nI-click ang System Summary.\nTingnan sa ilalim ng patlang na "System Model".\nKopyahin ang Pangalan at Numero ng Modelo sa mga katumbas na patlang sa ibaba."',
