    'en-UK': 'Loading...',
    fi: 'Loading...',
    fr: "1. Fermez votre œil DROIT. (Ceci est le côté droit de l'écran.)\n2. Utilisez la touche fléchée ◀ pour faire glisser le point clignotant. Tout en regardant la croix, surveillez le point clignotant du coin de l'œil, et faites-le glisser de gauche à droite jusqu'à ce qu'il disparaisse dans votre angle mort.\n3. Appuyez sur ENTRÉE.\nNOTE : Gardez votre regard sur la croix. Le point clignotant ne disparaîtra pas tant que votre œil le suit.",
    de: '1. Schließe dein RECHTES Auge. (Dies ist die rechte Seite des Bildschirms.)\n2. Verwende die ◀ Pfeiltaste, um den flackernden Punkt zu verschieben. Während du auf das Fadenkreuz schaust, beobachte den flackernden Punkt im Augenwinkel und schiebe ihn nach links und rechts, bis er in deinem Blindenpunkt verschwindet.\n3. Drücke RETURN.\nHINWEIS: Behalte das Fadenkreuz im Auge. Der flackernde Punkt wird nicht verschwinden, solange dein Auge ihm folgt.',
    el: 'Loading...',
    he: 'Loading...',
    hi: 'Loading...',
    hu: 'Loading...',
    is: 'Loading...',
    id: 'Loading...',
    it: "1. Chiudi il tuo occhio DESTRO. (Questo è il lato destro dello schermo.)\n2. Usa la freccia ◀ per far scorrere il punto lampeggiante. Mentre guardi la croce, osserva il punto lampeggiante nell'angolo del tuo occhio e fallo scorrere a sinistra e a destra fino a quando non scompare nel tuo punto cieco.\n3. Premi INVIO.\nNOTA: Mantieni lo sguardo sulla croce. Il punto lampeggiante non scomparirà mentre il tuo occhio lo segue.",
    ja: '1. 右目を閉じてください。（これは画面の右側です。）\n2. ◀ 矢印キーを使用して、点滅する点をスライドさせてください。十字線を見ながら、目の隅に点滅する点を見て、それが見えなくなるまで左右にスライドさせてください。\n3. RETURN キーを押してください。\n注意：十字線を見続けてください。点滅する点は、目がそれに追従している間は消えません。',
    kn: 'Loading...',
    ko: '1. 오른쪽 눈을 감으세요. (이것은 화면의 오른쪽입니다.)\n2. ◀ 화살표 키를 사용하여 깜빡이는 점을 슬라이드하세요. 십자선을 바라보면서 눈 꼬리에 깜빡이는 점을 지켜보고, 왼쪽과 오른쪽으로 슬라이드하여 맹점에 사라질 때까지 이동시킵니다.\n3. RETURN을 누르세요.\n참고: 십자선을 바라보세요. 눈이 따라가는 동안 깜빡이는 점은 사라지지 않습니다.',
    lt: '1. Uždarykite savo DEŠINĮ akį. (Tai yra ekrano dešinė pusė.)\n2. Naudokite ◀ rodyklės klavišą, kad slenkstumėte mirksinčią taškę. Kol žiūrite į kryžiaus linijas, stebėkite mirksinčią tašką savo aklavietės kampe ir slenkstykite jį kairėn ir dešinėn, kol jis išnyks į jūsų aklavietę.\n3. Paspauskite GRĮŽTAMOJO mygtuką.\nPASTABA: Laikykite akį ant kryžiaus linijų. Mirksinčio taško nepradings, kol jūsų akis jį seka.',
    ms: 'Loading...',
    ml: 'Loading...',
    no: 'Loading...',
    fa: '1. چشم راست خود را ببندید. (این سمت راست صفحه است.)\n2. از کلید جهت‌دهی ◀ استفاده کنید تا نقطه‌ی چشمک‌زن را لغزان کنید. در حالی که به محورهای صلیبی نگاه می‌کنید، نقطه‌ی چشمک‌زن را در گوشه‌ی چشم خود مشاهده کنید و آن را به سمت چپ و راست لغزان کنید تا در نقطه کور چشم شما ناپدید شود.\n3. دکمه RETURN را فشار دهید.\nتوجه: چشم خود را بر روی محورهای صلیبی نگه دارید. نقطه‌ی چشمک‌زن در حالی که چشم شما آن را دنبال می‌کند، ناپدید نخواهد شد.',
    pl: 'Loading...',
    pt: '1. Feche o olho DIREITO. (Este é o lado direito da tela.)\n2. Use a tecla ◀ seta para deslizar o ponto piscante. Enquanto olha para a mira, monitore o ponto piscante no canto do seu olho e deslize-o para a esquerda e para a direita até que ele desapareça em seu ponto cego.\n3. Pressione ENTER.\nNOTA: Mantenha o olho na mira. O ponto piscante não desaparecerá enquanto seu olho o acompanha.',
    ro: '1. Închideți ochiul DREPT. (Acesta este partea dreaptă a ecranului.)\n2. Utilizați tasta săgeată ◀ pentru a glisa punctul care clipește. În timp ce vă uitați la punctul de intersecție, monitorizați punctul care clipește în colțul ochiului și glisați-l în stânga și în dreapta până când dispare în punctul orb.\n3. Apăsați tasta RETURN.\nNOTĂ: Mențineți ochiul pe punctul de intersecție. Punctul care clipește nu va dispărea în timp ce ochiul îl urmărește.',
    ru: 'Loading...',
    sr: 'Loading...',
    es: '1. Cierra tu ojo DERECHO. (Este es el lado derecho de la pantalla.)\n2. Usa la tecla de flecha ◀ para deslizar el punto parpadeante. Mientras miras la cruz, observa el punto parpadeante en el rabillo del ojo y deslízalo hacia la izquierda y derecha hasta que desaparezca en tu punto ciego.\n3. Pulsa RETURN.\nNOTA: Mantén tu vista en la cruz. El punto parpadeante no desaparecerá mientras tu ojo lo siga.',
    su: 'Loading...',
    sw: 'Loading...',
    sv: 'Loading...',
    tl: 'Loading...',
    tr: '1. Sağ gözünü kapat. (Bu ekranın sağ tarafıdır.)\n2. ◀ ok tuşunu kullanarak yanıp sönen noktayı kaydırın. Çapraz teli izlerken, göz köşesindeki yanıp sönen noktayı gözünüzün kör noktasına kaybolana kadar sola ve sağa kaydırın.\n3. RETURN tuşuna basın.\nNOT: Gözünüzü çapraz teli üzerinde tutun. Yanıp sönen nokta, gözünüz onu takip ettiği sürece kaybolmayacaktır.',
    ur: '1. اپنی دائیں آنکھ بند کریں۔ (یہ اسکرین کا دائیں حصہ ہے۔)\n2. فلکرنگ نقطے کو سلائیڈ کرنے کے لئے ◀ ایرو کی استعمال کریں۔ کراس ہیئرز پر نظر رکھتے ہوئے، آنکھ کے کونے میں فلکرنگ نقطے کو نظرانداز کریں، اور اسے بائیں اور دائیں سمت میں سلائیڈ کریں جب تک کہ یہ آپ کے اندھیرے حصے میں غائب نہ ہو جائے۔\n3. ریٹرن دبائیں۔\nنوٹ: کراس ہیئرز پر آپ کی آنکھ رکھیں۔ جب تک آپ کی آنکھ اس کے پیچھے نہیں جاتی، فلکرنگ نقطہ غائب نہیں ہوگا۔',
