    hu: 'A szeme xx1 cm-re van a képernyőtől, de a kísérlethez xx2 cm-re van szüksége. A kísérlet akkor folytatódik, ha eléri a megfelelő távolságot.',
    is: 'Augu þín eru xx1 cm frá skjánum, en tilraunin þarf um xx2 cm. Tilraunin mun halda áfram þegar þú nærð réttu fjarlægðinni.',
    id: 'Mata Anda berjarak xx1 cm dari layar, namun eksperimen memerlukan xx2 cm. Eksperimen akan dilanjutkan ketika Anda mencapai jarak yang benar.',
    it: "I tuoi occhi sono a xx1 cm dallo schermo, ma l'esperimento richiede xx2 cm. L'esperimento riprenderà quando raggiungerai la distanza corretta.",
    ja: 'あなたの目は画面から xx1 cm 離れていますが、実験には xx2 cm が必要です。正しい距離に到達すると実験が再開されます。',
    kn: 'ನಿಮ್ಮ ಕಣ್ಣುಗಳು ಪರದೆಯಿಂದ xx1 cm, ಆದರೆ ಪ್ರಯೋಗಕ್ಕೆ xx2 cm ಅಗತ್ಯವಿದೆ. ನೀವು ಸರಿಯಾದ ದೂರವನ್ನು ತಲುಪಿದಾಗ ಪ್ರಯೋಗವು ಪುನರಾರಂಭವಾಗುತ್ತದೆ.',
    ko: '당신의 눈은 화면에서 xx1cm 떨어져 있지만 실험에는 xx2cm가 필요합니다. 올바른 거리에 도달하면 실험이 재개됩니다.',
    lt: 'Jūsų akys yra xx1 cm atstumu nuo ekrano, bet eksperimentui reikia xx2 cm. Eksperimentas bus tęsiamas, kai pasieksite reikiamą atstumą.',
    ms: 'Mata anda adalah xx1 cm dari skrin, tetapi percubaan memerlukan xx2 cm. Percubaan akan disambung semula apabila anda mencapai jarak yang betul.',
    ml: 'നിങ്ങളുടെ കണ്ണുകൾ സ്ക്രീനിൽ നിന്ന് xx1 സെൻ്റിമീറ്ററാണ്, പക്ഷേ പരീക്ഷണത്തിന് xx2 സെൻ്റീമീറ്റർ ആവശ്യമാണ്. നിങ്ങൾ ശരിയായ ദൂരത്തിൽ എത്തുമ്പോൾ പരീക്ഷണം പുനരാരംഭിക്കും.',
    no: 'Øynene dine er xx1 cm fra skjermen, men eksperimentet trenger xx2 cm. Eksperimentet gjenopptas når du når riktig avstand.',
    fa: 'چشمان شما xx1 سانتی متر از صفحه نمایش فاصله دارد، اما آزمایش به xx2 سانتی متر نیاز دارد. زمانی که به فاصله صحیح برسید، آزمایش از سر گرفته می شود.',
    pl: 'Twoje oczy są xx1 cm od ekranu, ale eksperyment wymaga około xx2 cm. Eksperyment zostanie wznowiony, gdy osiągniesz odpowiednią odległość.',
    pt: 'Seus olhos estão a xx1 cm da tela, mas o experimento precisa de xx2 cm. O experimento será retomado quando você atingir a distância correta.',
    ro: 'Ochii tăi sunt la xx1 cm de ecran, dar experimentul are nevoie de xx2 cm. Experimentul se va relua când ajungeți la distanța corectă.',
    ru: 'Ваши глаза находятся на расстоянии xx1 см от экрана, но для эксперимента требуется примерно xx2 см. Эксперимент возобновится, когда вы достигнете правильного расстояния.',
    sr: 'Ваше очи су кк1 цм од екрана, али за експеримент је потребно кк2 цм. Експеримент ће се наставити када достигнете тачну удаљеност.',
    es: 'Tus ojos están a xx1 cm de la pantalla, pero el experimento necesita xx2 cm. El experimento se reanudará cuando alcances la distancia correcta.',
    su: 'Panon anjeun xx1 cm ti layar, tapi percobaan perlu xx2 cm. Eksperimen bakal diteruskeun nalika anjeun ngahontal jarak anu leres.',
    sw: 'Macho yako ni sentimita xx1 kutoka kwenye skrini, lakini jaribio linahitaji sentimita xx2. Jaribio litaendelea utakapofika umbali sahihi.',
    sv: 'Dina ögon är xx1 cm från skärmen, men experimentet behöver cirka xx2 cm. Experimentet kommer att återupptas när du når rätt avstånd.',
    tl: 'Ang iyong mga mata ay xx1 cm mula sa screen, ngunit ang eksperimento ay nangangailangan ng xx2 cm. Magpapatuloy ang eksperimento kapag naabot mo ang tamang distansya.',
    tr: 'Gözleriniz ekranın xx1 cm uzağında, ancak deney yaklaşık olarak xx2 cm gerektiriyor. Doğru mesafeye ulaştığınızda deney devam edecektir.',
    ur: 'آپ کی آنکھیں اسکرین سے xx1 سینٹی میٹر دور ہیں، لیکن تجربے کے لیے xx2 سینٹی میٹر کی ضرورت ہے۔ تجربہ دوبارہ شروع ہو جائے گا جب آپ صحیح فاصلے پر پہنچ جائیں گے۔',
