    el: "Πέρα από τα 111 cm, είναι πιο δύσκολο να φτάσετε στο πληκτρολόγιο του υπολογιστή σας, γι' αυτό μη διστάσετε να χρησιμοποιήσετε το πληκτρολόγιο στο smartphone σας.",
    he: '"מעבר ל-111 ס"מ, קשה יותר להגיע למקלדת המחשב שלך, אז אתה יכול להשתמש במקלדת הטלפון הנייד במקום."',
    hi: '111 सेमी से अधिक, आपके कंप्यूटर के कीबोर्ड तक पहुंचना कठिन है, इसलिए बेझिझक इसके बजाय अपने स्मार्टफोन पर कीपैड का उपयोग करें।',
