    tl: 'Nawala ang koneksyon. Kumonekta muli sa pamamagitan ng pagre-refresh ng page na ito. Upang gawin iyon, i-tap lang ang icon ng pag-refresh ↻ sa address bar. Kung walang ↻, i-tap ang “…” o “⋮” sa menu bar para makakuha ng drop-down na menu. Mula sa menu na iyon piliin ang "I-refresh" o "I-reload".',
    tr: 'Daha yaklaş',
    ur: 'کنکشن ٹوٹ گیا۔ اس صفحہ کو ریفریش کرکے دوبارہ جڑیں۔ ایسا کرنے کے لیے، ایڈریس بار میں صرف ریفریش آئیکن ↻ پر ٹیپ کریں۔ اگر کوئی ↻ نہیں ہے، تو ڈراپ ڈاؤن مینو حاصل کرنے کے لیے مینو بار میں "…" یا "⋮" کو تھپتھپائیں۔ اس مینو سے "ریفریش" یا "دوبارہ لوڈ" کو منتخب کریں۔',
