    hy: 'Հպեք վերևի աջ անկյունում գտնվող երեք հորիզոնական գծերին՝ հասցեի տողը բացահայտելու համար: Հպեք շրջանաձև սլաքի պատկերակին ⤾, որը գտնվում է հասցեի տողում՝ էջը թարմացնելու համար:',
    bg: 'Докоснете трите хоризонтални линии в горния десен ъгъл, за да разкриете адресната лента. Докоснете иконата с кръгла стрелка ⤾, разположена в адресната лента, за да опресните страницата.',
