    he: 'הקש על שלושת הקווים האופקיים בפינה השמאלית העליונה כדי לחשוף את שורת הכתובת. הקש על סמל החץ העגול ⤾ הממוקם בשורת הכתובת כדי לרענן את העמוד.',
    hi: 'पता बार दिखाने के लिए ऊपरी दाएं कोने में तीन क्षैतिज रेखाओं पर टैप करें। पेज को रीफ्रेश करने के लिए एड्रेस बार में स्थित गोलाकार तीर आइकन ⤾ पर टैप करें।',
