      'PROBLEM? If the distance seems terribly wrong, click here to recalibrate it, and restart this block.',
    ar: 'مشكلة؟ إذا بدا أن المسافة خاطئة بشكل فظيع، انقر هنا لإعادة معايرتها، وأعد تشغيل هذه الكتلة.',
    hy: 'ԽՆԴԻՐ. Եթե ​​հեռավորությունը ահավոր սխալ է թվում, սեղմեք այստեղ՝ այն վերահաշվարկելու համար և վերագործարկեք այս բլոկը:',
    bg: 'ПРОБЛЕМ? Ако разстоянието изглежда ужасно грешно, щракнете тук, за да го калибрирате отново и рестартирайте този блок.',
