    ar: 'المشاركة في هذه الدراسة تتيح لك إمكانية المساهمة بشكل فعّال في تقدم البحوث السمعية عبر الإنترنت من خلال توفير بيانات أساسية حول التنوع الواسع في ميكروفونات الهواتف الذكية ومكبرات الصوت الخاصة بالحواسيب. تهدف هذه البحوث إلى إنشاء مكتبة مفصلة لملفات الأجهزة التي ستعزز دقة الاختبارات السمعية التي تُجرى عبر الإنترنت. يعتمد النظام على مطابقة ميكروفون الهاتف الخاص بالمستخدم مع ميكروفون معاير في المختبر. لكل طراز ميكروفون مختلف، لذا من الضروري تحديد الطراز.\n\nمع العلم أن الخصوصية تعتبر أولوية، يرجى الاطمئنان بأن هذا الاستطلاع يحتفظ فقط بأرقام طرازات الهواتف والحواسيب. هذه الأرقام الطرازية ليست مرتبطة بأي معلومات شخصية ولا يمكن استخدامها لتحديد هويتك بشكل فردي.',
