    bg: 'За съжаление QR кодът не се появи. Обновете ↻ страницата за нов опит. Ако проблемът продължава, натиснете бутона НЕ МОЖЕ ДА СЕ СВЪРЖЕТЕ ЧРЕЗ QR КОД по-долу.',
