    kn: '⚠ ಏಕೆಂದರೆ ಈ ಅಧ್ಯಯನವು ಮೈಕ್ರೊಫೋನ್‌ಗಳನ್ನು ಮಾಪನಾಂಕ ಮಾಡುತ್ತದೆ (_calibrateSoundMicrophonesBool==TRUE), ನಿಮ್ಮ ಧ್ವನಿವರ್ಧಕಗಳನ್ನು ಮಾಪನ ಮಾಡಲು ನಿಮಗೆ USB ಮೈಕ್ರೊಫೋನ್ (miniDSP UMIK-1 ಅಥವಾ UMIK-2) ಅಗತ್ಯವಿದೆ.',
