    ar: '٣. الميكروفون في الحافة السفلية. عندما يكون هاتفك عموديًا، يكون الميكروفون في الحافة السفلية.\n٤. إزالة الغطاء. اكشف عن ميكروفون هاتفك بإزالة أي غطاء واقٍ.\n٥. ضع الهاتف على كوب شرب طويل (أو فنجان قهوة أو علبة صودا/بيرة أو جرة أو صندوق أو كومة من الكتب)، بينك وبين لوحة المفاتيح، بحيث تكون الحافة السفلية (الميكروفون) موجهة نحو الكمبيوتر.\n     مكبرات الصوت في الكمبيوتر المحمول تكون في لوحة المفاتيح؛ ضع هاتفك بحيث يكون الميكروفون في خط رؤيتك للوحة المفاتيح.\n     مكبرات الصوت في الكمبيوتر المكتبي تكون خلف الشبكة؛ وجه هاتفك نحو الشبكة.\n٦. اضبط الكمبيوتر على وضع عدم الإزعاج.\n      ماكنتوش: 🟰 لوحة التحكم > التركيز > عدم الإزعاج\n     ⊞ ويندوز: ابدأ > الإعدادات > النظام > الإشعارات > عدم الإزعاج\n٧. المتابعة. عندما تكون جاهزًا للمعايرة، انقر على زر المتابعة الذي سيظهر أدناه.',
