    ar: 'ضع هذا الهاتف على المنصة التي صنعتها، مثل كوب زجاجي أو فنجان أو علبة. قم بتدويري لقراءة التعليمات أدناه.',
    hy: '1. Տեղադրեք այս հեռախոսը ձեր ստեղծած հարթակի վրա, օրինակ՝ բաժակ, գավաթ կամ բանկա: \n2. Պտտեցնել ինձ՝ ստորև ներկայացված հրահանգները կարդալու համար:',
    bg: '1. Поставете този телефон върху платформата, която сте създали, като чаша, чаша или кутия. \n2. Завъртете ме, за да прочета инструкциите по-долу.',
