    he: 'גודל האותיות והמרווח משתנים מגדול וקל למטה ועד זעיר וקשה. אתה לא יכול לקבל הרבה יותר משני שליש נכון, אז תירגע. תחשוב על זה כעל משחק ניחושים, ופשוט קבל כמה שאתה יכול. אתה תשמע צפצוף בכל פעם שאתה צודק.',
