    hu: 'Betűméret és a betűk közötti távolság változik a nagy és könnyű között a pici és nehéz vagy lehetetlen között. Nem kaphat több mint két harmadot, tehát lazuljon el. Gondoljon erre úgy, mint egy találgatásra, és csak annyit kapjon, amennyit tud. Hangjelzést fog hallani, amikor helyes.',
