    hi: 'यह बाएं ओर स्थानांतरित हो गया है। यह प्रदर्शन स्थिर है, इसलिए लाइनों पर अपनी आंखें ले जाना और स्थानांतरित करना आसान होगा। लेकिन, एक वास्तविक परीक्षण में, लाइनें फ्लैश होती हैं, इसलिए आपको अपनी आंखें नहीं हिलाने का समय नहीं होता। हर परीक्षण को शुरू करते समय क्रॉस हेयर्स पर ध्यान देना महत्वपूर्ण है। लाइनें तुरंत फ्लैश हो जाएंगी। फ्लैश के बाद आपकी आंखें कहां भी जाएं, इसका कोई महत्व नहीं है। पहला टेस्टिंग ब्लॉक असल में शुरू होने से पहले कुछ प्रैक्टिस के कुछ ही परीक्षण होते हैं।',
    hu: 'Это R. Этот дисплей статичен, поэтому было бы легко переместить ваши глаза на букву и идентифицировать ее. Но, в реальном исследовании, буквы вспыхнут, поэтому не будет времени перемещать глаза. Важно посмотреть на прицел, когда вы нажимаете на нее. Буквы будут мигать немедленно. Неважно, где ваши глаза идут после вспышки. Первый блок тестирования - это всего лишь несколько тренировочных испытаний, прежде чем начать всерьез.',
    is: 'Loading...',
    id: 'Loading...',
