    hi: 'प्रत्येक प्रयास पर, जब आप ध्यान से निशानों को देखते हैं, कहीं एक रेखा की चमक होगी। शायद वहां होगी जहां आप देख रहे हैं; शायद आपकी आंख के कोने में होगी। बस एक चमक। कार्य को सीखने के लिए, आइए इसे पहले स्थिर प्रदर्शन के साथ प्रयास करें। निशानों को देखते हुए, नीचे दिए गए निशानों के संबंध में ऊपरी रेखा बाएं या दाएं में स्थानांतरित है?',
