    lt: 'Loading...',
    ms: 'Loading...',
    ml: 'Loading...',
    no: 'На каждом испытании, пока вы смотрите на прицел, триплет из трех случайных букв будет мигать в углу глаза. Просто вспышка. Чтобы узнать задачу, давайте сначала попробуем ее со статическим дисплеем. Пока вы смотрите на прицел, ниже, не двигая глазами, попробуйте определить среднюю букву.',
    fa: '"На каждом испытании, пока вы смотрите на прицел, триплет из трех случайных букв будет мигать в углу глаза. Просто вспышка. Чтобы узнать задачу, давайте сначала попробуем ее со статическим дисплеем. Пока вы смотрите на прицел, ниже, не двигая глазами, попробуйте определить среднюю букву."\n\nTranslated to Russian:\n"На каждом испытании, пока вы смотрите на прицел, триплет из трех случайных букв будет мигать в углу глаза. Просто вспышка. Чтобы узнать задачу, давайте сначала попробуем ее со статическим дисплеем. Пока вы смотрите на прицел, ниже, не двигая глазами, попробуйте определить среднюю букву."',
    pl: 'Podczas każdej proby gdy patrzysz na krzyżyk pojawią się trzy losowe litery w kącie pola widzenia. Podczas gdy patrzysz na krzyżyk, bez przenoszenia wzroku na inne części ekranu, spróbuj zidentyfikować środkową literę.\n \n\n',
    pt: 'Loading...',
    ro: 'Loading...',
    ru: 'Loading...',
    sr: 'Loading...',
    es: 'En cada prueba, mientras miras la cruz, un trío de tres letras aleatorias aparecerá de repente en la esquina de tu ojo. Solo un destello. Para aprender la tarea, probemos primero con una muestra ESTÁTICA. Mientras miras la cruz, abajo, sin mover tus ojos: ¿Cuál es la letra del medio?\n                    +.              H R C\nEs una R. Esta muestra es estática, por lo que sería fácil mover los ojos hacia la letra e identificarla. Pero, en una prueba real, la letra se MUESTRA RÁPIDAMENTE, así que no hay tiempo para mover los ojos. Es importante mirar la cruz al iniciar la prueba. La letra aparecerá de inmediato. No importa a dónde vayan tus ojos después del destello. El primer bloque de pruebas es solo unas pocas pruebas de práctica, antes de comenzar en serio.',
    su: 'Loading...',
