    lt: 'Netrukus pradėsite 111 bandymų bloką. Jūs skaitysite istoriją, po kelis žodžius. Kiekvienas bandymas greitai parodys sakinio vertės žodžius vienas po kito, o tada paprašys prisiminti perskaitytus žodžius.',
    ms: 'Anda akan memulakan satu blok 111 percubaan. Anda akan membaca sebuah cerita, beberapa perkataan pada satu masa. Setiap percubaan akan dengan cepat menunjukkan kepada anda kira-kira satu ayat perkataan, satu demi satu, dan kemudian meminta anda untuk mengingati perkataan yang anda baca.',
