    ro: 'Sunteți pe cale să începeți un bloc de 111 încercări. Vei citi o poveste, câteva cuvinte la un moment dat. Fiecare încercare vă va arăta rapid despre o propoziție de cuvinte, unul după altul, apoi vă va cere să vă amintiți cuvintele pe care le-ați citit.',
