    es: 'Estás a punto de comenzar un bloque de 111 pruebas. Leerás una historia, unas pocas palabras cada vez. Cada prueba te mostrará rápidamente aproximadamente el valor de una oración de palabras, una tras otra, y luego te pedirá que recuerdes las palabras que leíste.',
