    tl: 'Magsisimula ka na ng isang bloke ng 111 na pagsubok. Magbabasa ka ng isang kuwento, ilang salita sa isang pagkakataon. Ang bawat pagsubok ay mabilis na magpapakita sa iyo tungkol sa isang pangungusap na nagkakahalaga ng mga salita, isa-isa, at pagkatapos ay hihilingin sa iyo na alalahanin ang mga salitang iyong nabasa.',
