    ur: 'آپ 111 ٹرائلز کا ایک بلاک شروع کرنے والے ہیں۔ آپ ایک وقت میں ایک کہانی، چند الفاظ پڑھ رہے ہوں گے۔ ہر ٹرائل آپ کو ایک کے بعد ایک جملے کے قابل الفاظ کے بارے میں تیزی سے دکھائے گا، اور پھر آپ سے ان الفاظ کو یاد رکھنے کو کہے گا جو آپ پڑھتے ہیں۔',
