    fr: "Il est temps de lire une histoire ! Vous allez lire 111 pages d'un livre. Une fois que vous commencez, veuillez lire silencieusement toutes les pages aussi rapidement que possible, tout en conservant une parfaite compréhension, jusqu'à ce que vous atteigniez la fin. Ensuite, nous vous poserons quelques questions sur l'histoire. Sur chaque page, appuyez sur la barre d'espace pour passer à la page suivante. Lorsque vous êtes prêt, appuyez sur ESPACE.",
