    hr: 'Počinje...',
    cs: 'Spuštění...',
    da: 'Starter...',
    nl: 'Bij elke test hoor je een zin, en dan wordt je gevraagd om twee van de woorden te onthouden. Het geluid is vervormd en kan moeilijk te herkennen zijn, dus je kunt ze niet allemaal goed krijgen. Maak je geen zorgen. Behandel het gewoon als een spel en doe je best. Veel succes. Druk op RETURN of klik op DOORGAAN om door te gaan.\n\nDe DOORGAAN knop verdwijnt onmiddellijk, en het experiment begint zodra de geluiden zijn geladen, wat 40 seconden of langer kan duren, afhankelijk van de snelheid van de internetverbinding. We werken eraan om deze vertraging in een toekomstige release te verkorten.\n\nGeluiden laden ...',
    'en-UK': 'Starting ...',
    fi: 'Alkaen...',
    fr: "À chaque essai, vous entendrez une phrase, puis on vous demandera de vous souvenir de deux mots. Le son est déformé et peut être difficile à reconnaître, donc vous ne pourrez pas tous les avoir correctement. Ne vous inquiétez pas. Considérez cela comme un jeu et faites de votre mieux. Bonne chance. Appuyez sur ENTRÉE ou cliquez sur CONTINUER pour poursuivre.\n\nLe bouton CONTINUER disparaîtra immédiatement, et l'expérience commencera une fois les sons chargés, ce qui prend 40 secondes ou plus, selon la vitesse de la connexion internet. Nous travaillons à réduire ce délai dans une future mise à jour.\n\nChargement des sons ...",
    de: 'Bei jedem Versuch hören Sie einen Satz und werden dann gebeten, sich an zwei der Wörter zu erinnern. Der Ton ist verzerrt und möglicherweise schwer zu erkennen, daher können Sie nicht alle richtig bekommen. Machen Sie sich keine Sorgen. Betrachten Sie es einfach als Spiel und geben Sie Ihr Bestes. Viel Glück. Drücken Sie RETURN oder klicken Sie auf WEITER, um fortzufahren.\n\nDer WEITER-Button verschwindet sofort und das Experiment beginnt, sobald die Klänge geladen sind, was je nach Geschwindigkeit der Internetverbindung 40 Sekunden oder länger dauern kann. Wir arbeiten daran, diese Verzögerung in einer zukünftigen Version zu verkürzen.\n\nKlänge werden geladen ...',
