    it: "In ogni prova ascolterai una frase, e poi ti verrà chiesto di ricordare due delle parole. Il suono è distorto e potrebbe essere difficile da riconoscere, quindi non è possibile indovinarle tutte correttamente. Non preoccuparti. Trattalo come un gioco e fai del tuo meglio. Buona fortuna. Premi INVIO o clicca su PROCEDI per continuare.\n\nIl pulsante PROCEDI scomparirà immediatamente, e l'esperimento inizierà non appena i suoni saranno caricati, il che richiede 40 secondi o più, a seconda della velocità della connessione internet. Stiamo lavorando per ridurre questo ritardo in una futura versione.\n\nCaricamento dei suoni ...",
    ja: '「各試行では、文を聞いてから2つの単語を覚えるように求められます。音声は歪んでおり、認識が難しい場合があるため、すべて正しく覚えることはできません。心配しないでください。ただゲームとして取り組んで、最善を尽くしてください。幸運を祈ります。続行するにはRETURNキーを押すか、PROCEEDをクリックしてください。\n\nPROCEEDボタンはすぐに消え、音声が読み込まれると実験が開始されます。これにはインターネット接続の速度に応じて40秒以上かかる場合があります。将来のリリースでこの遅延を短縮するために取り組んでいます。\n\n音声を読み込んでいます...」',
